import React from 'react';

function Contact() {
  return (
    <section id="contact" style={{ marginLeft: "10px"}}>
      <h2>Contact Me</h2>
      <form style={{ 
      display: "flex", 
      alignItems: "center", 
      justifyContent: "center", 
      flexDirection: "column", 
      padding: "20px", 
      maxWidth: "600px" }}>
      <h2 style={{ color: "white" }}>Contact Me</h2>
      <div style={{ display: "flex", flexDirection: "column" }}>
        <label htmlFor="name" style={{ color: "white" }}>Name</label>
        <input type="text" id="name" style={{ 
          padding: "8px", 
          margin: "8px 0", 
          border: "1px solid #ccc" 
        }} />
        <label htmlFor="email" style={{ color: "white" }}>Email</label>
        <input type="email" id="email" style={{ 
          padding: "8px", 
          margin: "8px 0", 
          border: "1px solid #ccc" 
        }} />
        <label htmlFor="message" style={{ color: "white" }}>Message</label>
        <textarea id="message" style={{ 
          padding: "8px", 
          margin: "8px 0", 
          border: "1px solid #ccc" 
        }}></textarea>
        <button type="submit" style={{ 
          padding: "8px", 
          margin: "8px 0", 
          borderRadius: "5px", 
          backgroundColor: "#27ae60", 
          color: "white", 
          border: "none" 
        }}>Submit</button>
      </div>
    </form>
    </section>
  );
}

export default Contact;
